import React from "react";
import { Collapse } from "antd";

const {Panel} = Collapse;

function CheckBox() {
  return (
    <div>

      <Collapse defaultActiveKey={["1"]} >
        <Panel header="This is panel header 1" key="1">
          <p>Heelo</p>
        </Panel>
      </Collapse>
    </div>
  );
}

export default CheckBox;
